import React from "react";
import styles from "./CurrenctySwitcher.module.css";

const CurrencySwitcher = () => {
  const currencyQuery = {
    data: {
      currencies: [
        {
          label: "USD",
        },
        {
          label: "GBP",
        },
        {
          label: "AUD",
        },
        {
          label: "JPY",
        },
        {
          label: "RUB",
        },
      ],
    },
  };

  return (
    <div className={styles.container}>
      <div className={styles.currencies}>
        <p>$ EUR</p>
        <p>$ EUR</p>
        <p>$ EUR</p>
        <p>$ EUR</p>
        <p>$ EUR</p>
      </div>
    </div>
  );
};

export default CurrencySwitcher;
